import React, { useState, useEffect } from 'react';
import {Navbar, Nav, Container, Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import styled from "styled-components";
import {useNavigate} from 'react-router-dom';
import logo from '../imgs/logo.png';

const Navigate = () => {
    const navigate = useNavigate();

    const MainButton = () => {      //로고 클릭시 메인페이지 이동
        navigate("/");
    }

    const handleLogin = () => {
        navigate("/login")
    };

    const handleSignUp = () => {
        navigate("/register")
    };

    return (
        <TopNav>
        <Navbar style={{ position: "fixed", backgroundColor: "white", boxShadow: "1.5px 1.5px 1.5px 1.5px #F3F4F6", width: "100%", zIndex: "1000" }}>
                <Navbar.Brand >
                    <UserImg onClick={MainButton}>
                        <img className="logoImage" alt="Logo" src={logo} />
                    </UserImg>
                    <Button color="inherit" variant="light" onClick={handleLogin} style={{ marginRight: '0.5rem' }}>로그인</Button>
                    <Button color="inherit" variant="light" onClick={handleSignUp}>회원가입</Button>

                </Navbar.Brand>
        </Navbar>
        </TopNav>
    )
}

const TopNav = styled.div`
  height: 18vh;
  background-color: yellow;

`

const LogoImg = styled.img`
  height: 5vh;
  width: auto; 
  cursor: pointer;
`;

const UserImg = styled.button`
  background: none;
  border: none;
  cursor: pointer;
`;

const Nav_Str = styled.div`

  display: flex;
  flex-direction: row;
  width: 100vw;
  justify-content: space-between;
  align-items: center;

`

export default Navigate;
